def print_(message, severity="INFO"):
    # Set account id in the beginning of your CF call
    try:
        print(json.dumps({"accountId":ACCOUNTID_LOG, "severity":severity,
                          "message": message, "cloudFunctionExecutionId": str(CF_EXECUTION_ID)}))
    except:
        print(message)

